Privacy Policy







Privacy Statement
This document describes the Privacy Policy of Invesco Limited related to information collected and held by Invesco from visitors to its public Internet sites. The purpose of this Privacy Policy is to outline how we deal with any personal data you provide to us while visiting our website and Invesco Online. Please note that the Privacy Policy is subject to the Terms and Conditions of use of our website and Invesco Online.  We recommend that you read the Terms and Conditions on our website and on Invesco Online. The contents of this Privacy Statement are subject to change and to being updated from time to time without notice.
General Statement
Invesco respects your right to privacy. We will not collect any information about you when you visit this website unless you elect to provide it to us.
Data Protection
In relation to Invesco Online, Invesco acts as a Data Processor under the terms of the Data Protection Acts 1988 to 2003 (as amended) (the Acts) in respect of the personal data we process for the purpose of providing our services to a user. We will not, unless required by law, process any personal or sensitive personal data acquired or used by us in the course of our work for the user ("Data") other than for the purpose of providing our services to the user, or for,purposes ancillary thereto.  We will implement and maintain appropriate technological, physical and organisational security measures as are necessary to keep the user's personal data secure from unauthorised access, disclosure, destruction or accidental loss. These measures shall be appropriate to the harm which might result from any unauthorised or unlawful processing, accidental loss, destruction or damage to your personal data and having regard to its nature. Users are entitled under the Acts to access their personal information held by Invesco upon request and to require Invesco to correct any errors of fact which may exist.  Any such requests should initially be forwarded to the Data Protection Officer at Invesco.
Cookies
Cookies are a technology which can be used to provide you with tailored information from a website. A cookie is an element of data that a website can send to your browser, which may then store it on your system. You can set your browser to notify you when you receive a cookie, giving you the chance to decide whether to accept it. We use cookies to help us measure the number of visits, average time spent, page views, and other statistics relating to our website. We use cookies to recognise you on subsequent visits.
Registered User
When you register with us on our websites with your e-mail address, you will be given the option of not receiving any such e-mail or other marketing contacts if you choose. We may send you communications of interest to you, including information about our products and services or about offerings from affiliates or third parties. In those communications, we will give instructions on how to unsubscribe if you later decide you do not want to receive any future e-mails or other marketing material from Invesco.
Security
Invesco maintains security standards and procedures with the intent of preventing unauthorised access to your data.   Invesco cannot guarantee the privacy or confidentiality of information relating to you passing over the Internet.We invite you to contact us if you have questions about this policy. You may contact us by e-mail at info@invesco.ie. You may call us at +353 1 2947600.
Copyright Notice
The information, content, graphics, text, sounds, images, buttons, trade marks, trade names and logos contained on the Online Service are protected by copyright, trademark, database right, sui generis right and other intellectual property laws, under national laws and international treaties. The User is granted a limited license solely for the User’s own personal, non-commercial use to refer to, bookmark or point to any page on the Online Service, and to download the materials contained to a single personal computer, and to print a single hard copy of the materials contained on the Online Service for the User’s own personal reference, provided however that all copyright, trademark and other proprietary notices are left intact. It is not permitted to reproduce (in whole or in part), modify, decompile, disassemble or transmit or use for any commercial purpose whatsoever any information from the Online Service without receiving the prior written consent of Invesco. The grant of this limited license is conditional on your agreement to and compliance with all of these terms and conditions of use.
Download
Access to and use of the Online Service is at the User's own risk and we do not warrant that the use of the Online Service or any material downloaded from it will not cause damage to any property, including but not limited to loss of data or computer virus infection.
Use of the Online Service
The User of the online service undertakes to comply strictly with the conditions and the operating instructions (which are designed to minimize the risk of unauthorized use of Invesco Online) and to indemnify Invesco in respect of any loss or damages which may arise as a consequence of the User’s non-compliance with the conditions and the operating instructions. Invesco shall not be, in any circumstances, liable to the User of the Online Service for any special, indirect loss or any loss of data or loss of profit suffered or incurred by the User of the Online Service. Invesco may decline to act on any instruction or request received in connection with Invesco Online unless it has been confirmed in writing and signed by the User of the Online Service.
Obligation of the User of the Online Service
The User shall provide and maintain, at their own expense any device needed to access Invesco Online and shall ensure that such equipment satisfies all technical and other requirements specified by Invesco. The User is responsible for disconnecting and clearing any information from any device used to access Invesco Online before leaving such devices unattended. All costs incurred by the User in accessing and utilizing Invesco Online including the cost of telephone calls and Internet access shall be at the User’s expense.
Security Questions
Invesco will provide the User with a username and password to access Invesco Online. The User shall keep their username and password safe, and shall not divulge any of them to any other person, or note them in any form that would be intelligible or otherwise accessible to a third party, or do or omit to do anything else that might enable irregular or unauthorised access to, or utilisation of Invesco Online. The User shall immediately notify Invesco if their security details are lost, mislaid, stolen or copied or revealed to another person or are otherwise compromised. In accessing Invesco Online and in availing of any of the services/information available on or via Invesco Online, the User accepts and is deemed to accept that an electronic mail messaging and Internet communication may not be free from interference by third parties and may not remain confidential.
Third Parties
Invesco may share data with third parties such as Life Companies or Auditors for purposes of fulfilling its legal and statutory obligations.
Termination of the Online Service
Invesco reserves the right to terminate the entitlement of any User to access Invesco Online. Repeated failure to successfully complete security checks on access to the system will result in suspension of the User’s authorisation. If this occurs, a message directing the User to contact Invesco will be displayed. The User should follow the instructions provided to reinstate access to the Online Service. Failure to access the Online Service over a specified period of time may also result in the suspension of the User’s access rights. The User may terminate their access to Invesco Online by notifying Invesco in writing.
Alteration of these Terms and Conditions
Invesco may at any time amend, supplement or replace these Terms and Conditions as a result of changes in Invesco’s policies, changes in technologies, to cater for new products, to comply with legal, taxation, or regulatory requirements or other circumstances affecting Invesco or the services it offers.
Indemnity
Invesco shall not be held liable for any loss or damage suffered by any person as a result of the User’s breach of any of the aforementioned Terms and Conditions.
Severance
Each of the provisions of these Terms and Conditions is severable from the others and if at any time anyone or more of such provisions, not being of a fundamental nature, is or becomes a legal, invalid or unenforceable, the validity, the legality and enforceability of the remaining provisions of these Terms and Conditions shall not in any way be affected or impaired.
Disclaimer
While Invesco uses reasonable efforts to ensure that the information contained on the Online Service is current, accurate and complete at the date of publication, no representations or warranties are made (express or implied) as to the reliability, accuracy or completeness of such information. Invesco, therefore, cannot be held liable for any loss or damages arising directly or indirectly from the use of, or any action taken in reliance on, any information appearing on the Online Service, whether this information is provided directly by Invesco, a sponsor or other information provider. The use of Invesco Online is at the User’s sole risk. Invesco does not endorse or approve the content of any third party site accessed by hypertext link or otherwise through this Online System nor will Invesco have any liability in connection with any such third party site. In addition, no warranty is given as to the freedom of the Online Service from errors, defects, viruses or other malicious programs or macros. Invesco reserves the right to suspend or withdraw access to the Online Service without notice at any time and accepts no responsibility for the Online Service not being available at all times.







